import { useNavigate } from 'react-router-dom';



const Weather = () => {

  const navclose=useNavigate();
  const handleClose=()=>{
    navclose('/Nav')
  }

  return (
    <>
      <div className="close-btn"><button onClick={handleClose}>X</button></div>
      div.
    </>
  )
}

export default Weather
